function Header(){

    return(
        <div>
            <h1> my website</h1>
            <nav>
                <ul>
                    <li style={{color:'red'}}><a href="#">home</a></li>
                    <li><a href="#">about</a></li>
                    <li><a href="#">services</a></li>
                    <li><a href="#">constcat</a></li>
                </ul>
            </nav>
        </div>
    );
}
export default Header
